import "../styles/home.css";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div className="home">
      <div className="main">
        <div className="cat-one">
          <Link to="catalog" img></Link>dioramas
        </div>
        <div className="cat-two">wargaming</div>
        <div className="cat-three">terrain</div>
        <div className="cat-four">military</div>
        <div className="cat-five">railroad</div>
        <div className="cat-six">paint</div>
        <div className="cat-seven">brushes</div>
        <div className="cat-eight">gaming supplies</div>
        <div className="cat-nine">model supplies</div>
        <div className="cat-ten">mats</div>
      </div>
      <hero></hero>
    </div>
  );
};

export default Home;
